      "content": "\u003cdiv class\u003d\"introduction img-head\"\u003e\r\n  \u003cdiv class\u003d\"header\"\u003e\r\n     \u003cimg src\u003d\"data:image/png;base64,\"\r\n        alt\u003d\"App Icon\"\u003e\r\n    \u003ch3\u003eBank Deposit Opening Prediction\u003c/h3\u003e\r\n  \u003c/div\u003e\r\n\r\n    \u003csection\u003e\r\n    \u003ch4\u003eOverview\u003c/h4\u003e\r\n    \u003cp\u003eThis app predicts whether a customer will subscribe to a term deposit based on previous marketing campaign data. It enables better targeting and higher success rates for future campaigns through intelligent, data-driven insights.\u003c/p\u003e\r\n  \u003c/section\u003e\r\n\r\n\u003csection\u003e\r\n    \u003ch4\u003eInput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eBank marketing dataset containing customer demographics, contact details, previous campaign outcomes, and economic indicators.\u003c/li\u003e\r\n       \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eFeatures include: age, job, marital, education, contact, poutcome, duration, campaign, pdays, previous, etc.\u003c/li\u003e\r\n  \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n\u003csection\u003e\r\n    \u003ch4\u003eOutput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003ePrediction of term deposit subscription (Yes/No) using a Random Forest model.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eKey model metrics: Accuracy, F1-score, Precision, Recall, and Confusion Matrix.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eSHAP value-based feature importance for explainability.\u003c/li\u003e\r\n       \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eBenefits\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eNo missing values detected in major categorical fields (age, job, marital, etc.).\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eMost applicants are married, educated at high school or university level, and do not have defaults or personal loans.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eThe duration of last contact is the most influential feature in predictions.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eHighest deposit conversion rates observed among retired, students, and previous campaign success segments.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003ePredictive accuracy of ~81% with strong performance on true positives.\u003c/li\u003e\r\n      \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\u003c/div\u003e",
